import{_ as r,c as l,o as e,a as i}from"./app.49dbb6c8.js";const g=`{"title":"1985/11/15 - \u4EE3\u3005\u6728\u4F53\u80B2\u9928","description":"","frontmatter":{},"headers":[{"level":3,"title":"\u66F2\u76EE\uFE55","slug":"\u66F2\u76EE\uFE55"},{"level":3,"title":"High School Rock'n'Roll","slug":"high-school-rock-n-roll"},{"level":3,"title":"\u5341\u4E03\u6B73\u306E\u5730\u56F3","slug":"\u5341\u4E03\u6B73\u306E\u5730\u56F3"},{"level":3,"title":"\uFF11\uFF15\u306E\u591C","slug":"\uFF11\uFF15\u306E\u591C"}],"relativePath":"Live/19851115.md","lastUpdated":1638960704602}`,o={},b=i('<h1 id="_1985-11-15-\u4EE3\u3005\u6728\u4F53\u80B2\u9928" tabindex="-1">1985/11/15 - \u4EE3\u3005\u6728\u4F53\u80B2\u9928 <a class="header-anchor" href="#_1985-11-15-\u4EE3\u3005\u6728\u4F53\u80B2\u9928" aria-hidden="true">#</a></h1><p>\u60F3\u7B11\u7684\u4EBA\u5118\u7BA1\u7B11\u3000\u76F8\u4FE1\u6211\u7684\u4EBA\u5C31\u8DDF\u8457\u4F86\u5427</p><hr><h3 id="\u66F2\u76EE\uFE55" tabindex="-1">\u66F2\u76EE\uFE55 <a class="header-anchor" href="#\u66F2\u76EE\uFE55" aria-hidden="true">#</a></h3><ol><li>\u5352\u696D</li><li>\u5F7C</li><li>Driving All Night</li><li>Bow !</li><li>\u8857\u306E\u98A8\u666F</li><li>\u30C0\u30F3\u30B9\u30DB\u30FC\u30EB</li><li>Teenage Blue</li><li>\u7C73\u8ECD\u30AD\u30E3\u30F3\u30D7</li><li>\u5742\u306E\u4E0B\u306B\u898B\u3048\u305F\u3042\u306E\u8857\u306B</li><li>Scrap Alley</li><li>\u5B58\u5728</li><li>High School Rock&#39;n&#39;Roll</li><li>Scrambling Rock&#39;n&#39;Roll</li><li>\u5341\u4E03\u6B73\u306E\u5730\u56F3</li><li>\u611B\u306E\u6D88\u3048\u305F\u8857</li><li>\u8DEF\u4E0A\u306E\u30EB\u30FC\u30EB</li><li>15\u306E\u591C</li></ol><p>\uFF0D\uFF25\uFF2E\uFF23\uFF2F\uFF32\uFF25\uFF0D</p><ol start="18"><li>Freeze Moon</li><li>I LOVE YOU</li><li>\u30B7\u30A7\u30EA\u30FC (SHELLY)</li></ol><hr><h3 id="high-school-rock-n-roll" tabindex="-1">High School Rock&#39;n&#39;Roll <a class="header-anchor" href="#high-school-rock-n-roll" aria-hidden="true">#</a></h3><blockquote><p>\u4FFA\u306F\u6700\u8FD1\u3053\u3093\u306A\u98A8\u306B\u601D\u3063\u3066\u3044\u308B\u3001\u82E5\u3055\u3063\u3066\u8A00\u3046\u306E\u306F\u30EB\u30FC\u30EB\u306B\u7E1B\u3089\u308C\u306A\u3044<br> \u3053\u3068\u306A\u3093\u3060\u3002\u305D\u3057\u3066\u3001\u81EA\u5206\u306B\u4E0E\u3048\u3089\u308C\u305F\u5168\u3066\u306E\u30EB\u30FC\u30EB\u306E\u4E2D\u3067\u3044\u3063\u305F\u3044\u4F55\u304C<br> \u5FC5\u8981\u3067\u4F55\u304C\u5FC5\u8981\u3067\u306A\u3044\u306E\u304B\u898B\u5206\u3051\u308B\u529B\u3092\u6301\u3063\u3066\u3044\u308B\u306E\u304C\u82E5\u3055\u3060\u3068\u601D\u3046\u3002<br> \u9593\u9055\u3063\u305F\u30EB\u30FC\u30EB\u3068\u3044\u3046\u306E\u306F\u4EBA\u3092\u50B7\u3064\u3051\u308B\u3053\u3068\u306E\u307F\u306B\u65B9\u5411\u304C\u5411\u304B\u3063\u3066\u3044\u308B\u3002<br> \u6B63\u3057\u3044\u30EB\u30FC\u30EB\u3068\u8A00\u3046\u306E\u306F\u4EBA\u3092\u611B\u3059\u308B\u3053\u3068\u3060\u3002<br> \u307F\u3093\u306A\u4FFA\u304C\u4F5C\u3063\u305F\u30CF\u30A4\u30B9\u30AF\u30FC\u30EB\u30ED\u30C3\u30AF\u30F3\u30ED\u30FC\u30EB\u3063\u3066\u66F2\u3092\u77E5\u3063\u3066\u308B\u304B\u3044\u3002<br> \u4EBA\u3092\u611B\u3057\u305F\u3044\u306A\u3089\u81EA\u5206\u306E\u5FC3\u306B\u5411\u304B\u3063\u3066\u53EB\u3076\u3093\u3060\u3001<br> \u305D\u308C\u304C\u30ED\u30C3\u30AF\u30F3\u30ED\u30FC\u30EB\u3060<br> \u307F\u3093\u306A\u4E00\u7DD2\u306B\u6B4C\u3063\u3066\u304F\u308C\u308B\u304B\u30FC\u3044\uFF1F<br> \u30EF\u30F3\u30FB\u30C8\u30A5\u30FC\u30FB\u30B9\u30EA\u30FC<br> \u30EF\u30F3\u30FB\u30C8\u30A5\u30FC\u30FB\u30EF\u30F3\u30C8\u30A5\u30FC\u30B9\u30EA\u30FC\u30D5\u30A9\u30FC</p></blockquote><p>\u6211\u6700\u8FD1\u9019\u6A23\u60F3\uFF0C\u6240\u8B02\u5E74\u8F15\u5C31\u662F\u4E0D\u88AB\u898F\u5247\u675F\u7E1B\u3002<br> \u800C\u4E14\uFF0C\u6211\u8A8D\u70BA\u64C1\u6709\u80FD\u529B\u53BB\u5206\u8FA8\u65BD\u5728\u81EA\u5DF1\u8EAB\u4E0A\u7684\u898F\u5247\u6709\u90A3\u4E9B\u662F\u5FC5\u8981\uFF0C\u6709\u90A3\u4E9B\u662F\u4E0D\u5FC5\u8981\u7684\uFF0C\u5C31\u6B63\u662F\u5E74\u8F15\u3002<br> \u932F\u8AA4\u7684\u898F\u5247\u5C31\u53EA\u6703\u6307\u5411\u50B7\u5BB3\u4EBA\u7684\u65B9\u5411\u3002<br> \u800C\u8AAA\u5230\u6B63\u78BA\u7684\u898F\u5247\u5C31\u662F\u611B\u4EBA\u3002<br> \u5404\u4F4D\u6709\u807D\u904E\u6211\u6240\u4F5C\u7684High School Rock&#39;n&#39;Roll\u55CE\uFF1F<br> \u60F3\u611B\u4EBA\u7684\u8A71\uFF0C\u5C31\u8981\u5411\u8457\u81EA\u5DF1\u7684\u5FC3\u547C\u53EB\u3002<br> \u90A3\u5C31\u662FRock&#39;n&#39;Roll\u3002<br> \u5927\u5BB6\u8981\u4E0D\u8981\u8DDF\u6211\u4E00\u8D77\u5531\uFF1F<br> ONE TWO THREE\uFF01<br> ONE TWO ONE TWO THREE FOUR\uFF01</p><br><h3 id="\u5341\u4E03\u6B73\u306E\u5730\u56F3" tabindex="-1">\u5341\u4E03\u6B73\u306E\u5730\u56F3 <a class="header-anchor" href="#\u5341\u4E03\u6B73\u306E\u5730\u56F3" aria-hidden="true">#</a></h3><blockquote><p>\u3053\u306E\u8857\u3067\u4E00\u756A\u611B\u3092\u6C42\u3081\u3066\u3044\u304F\u3046\u3048\u3067\u5FC5\u8981\u306A\u3053\u3068\u306F\u3001<br> \u81EA\u5206\u306B\u304B\u304B\u308F\u308B\u5168\u3066\u306E\u4EBA\u3084\u7269\u3092\u81EA\u5206\u306E\u93E1\u3068\u3057\u3066\u898B\u3064\u3081\u3066\u307F\u308B\u3053\u3068\u3060\u3002<br> \u305D\u306E\u4E2D\u306B\u3042\u308B\u7269\u4E8B\u306E\u771F\u5B9F\u3092\u81EA\u5206\u3068\u7167\u3089\u3057\u3042\u308F\u3057\u3001<br> \u81EA\u5206\u304C\u6C42\u3081\u308B\u611B\u306E\u59FF\u3092\u3082\u3046\u4E00\u5EA6\u4FFA\u306F\u3088\u304F\u8003\u3048\u3066\u307F\u305F\u3002<br> \u305D\u3057\u3066\u3001\u611B\u3059\u308B\u3053\u3068\u3068\u3044\u3046\u3053\u3068\u306B\u81EA\u5206\u306E\u547D\u3092\u8CED\u3051\u3066\u3001<br> \u7ACB\u3061\u5411\u304B\u308F\u306A\u3051\u308C\u3070\u3044\u3051\u306A\u3044\u3068\u3044\u3046\u3053\u3068\u306B\u6C17\u3065\u3044\u305F\u3093\u3060\u3002<br> \u5C11\u306A\u304F\u3068\u3082\u3001\u4ECA\u65E5\u3053\u3053\u306B\u96C6\u307E\u3063\u3066\u304D\u3066\u304F\u308C\u305F\u304A\u524D\u3089\u306E\u4E2D\u306B\u3001<br> \u4FFA\u3068\u4E00\u7DD2\u306B\u672C\u7269\u306E\u611B\u3084\u771F\u5B9F\u3092\u898B\u3064\u3051\u3088\u3046\u3068\u6B69\u3044\u3066\u3044\u304F\u9023\u4E2D\u304C\u3044\u308B\u306A\u3089\u3070\u3001<br> \u4FFA\u306F\u305D\u3044\u3064\u306E\u305F\u3081\u306B\u547D\u3092\u306F\u308B\u3002</p></blockquote><p>\u5728\u9019\u500B\u57CE\u5E02\u4E2D\u4E0D\u65B7\u53BB\u5C0B\u6C42\u611B\uFF0C<br> \u6700\u9700\u8981\u7684\u662F\u8A66\u8457\u5C07\u570D\u7E5E\u81EA\u5DF1\u7684\u4E00\u5207\u4EBA\u548C\u4E8B\u7269\uFF0C\u4F5C\u70BA\u4E00\u9762\u93E1\u5B50\u53BB\u770B\u3002<br> \u4EE5\u5176\u4E2D\u5B58\u5728\u7684\u4E8B\u7269\u7684\u771F\u5BE6\u548C\u81EA\u5DF1\u4F5C\u5C0D\u7167\uFF0C\u518D\u4E00\u6B21\u53BB\u5617\u8A66\u7D30\u5FC3\u60F3\u60F3\u81EA\u5DF1\u6240\u8FFD\u6C42\u7684\u611B\u7684\u6A21\u6A23\u3002<br> \u6B64\u5916\uFF0C\u6211\u767C\u89BA\u5FC5\u9808\u8981\u70BA\u611B\u8CED\u4E0A\u81EA\u5DF1\u7684\u6027\u547D\uFF0C\u52C7\u5F80\u76F4\u524D\u3002<br> \u81F3\u5C11\uFF0C\u5047\u5982\u4ECA\u65E5\u5728\u9019\u88E1\u805A\u96C6\u7684\u4F60\u5011\u7576\u4E2D\uFF0C<br> \u6709\u8DDF\u6211\u4E00\u8D77\u53BB\u5C0B\u627E\u771F\u6B63\u7684\u611B\u548C\u771F\u5BE6\u7684\u540C\u4F34\u5B58\u5728\u7684\u8A71\uFF0C\u6211\u6703\u70BA\u90A3\u4E9B\u4EBA\u62FC\u4E0A\u6211\u7684\u547D\u3002</p><br><h3 id="\uFF11\uFF15\u306E\u591C" tabindex="-1">\uFF11\uFF15\u306E\u591C <a class="header-anchor" href="#\uFF11\uFF15\u306E\u591C" aria-hidden="true">#</a></h3><blockquote><p>\u4ECA\u65E5\u306F\u307B\u3093\u3068\u306B\u3069\u3046\u3082\u3042\u308A\u304C\u3068\u3046\u3002<br> \u5FC3\u3092\u9589\u3056\u3057\u3066\u4ECA\u307E\u3067\u4FFA\u306F\u81EA\u5206\u4EE5\u5916\u306E\u3082\u306E\u3092\u53D7\u3051\u4ED8\u3051\u308B\u5FC3\u306E\u5E83\u3055\u3092<br> \u6301\u3063\u3066\u3044\u306A\u304B\u3063\u305F\u3088\u3046\u306A\u6C17\u304C\u3059\u308B\u3002<br> \u4ECA\u65E5\u306F\u5BA2\u5E2D\u306F\u771F\u3063\u6697\u3067\u898B\u3048\u306A\u3044\u3051\u3069\u3001<br> \u4E00\u756A\u5F8C\u308D\u306B\u3044\u308B\u304A\u307E\u3048\u306E\u9854\u3082\u4FFA\u306B\u306F\u3088\u304F\u898B\u3048\u308B\u3088\u3046\u306A\u6C17\u304C\u3059\u308B\u3093\u3060\u3002<br> \u4FFA\u306F\u4FE1\u3058\u3089\u308C\u308B\u4F55\u304B\u3092\u63A2\u3057\u3066\u3044\u308B\u3088\u3046\u306A\u6C17\u304C\u3059\u308B\u3002<br> \u3060\u304B\u3089\u3001\u4FFA\u306E\u8A00\u3046\u8A00\u8449\u4E00\u3064\u3072\u3068\u3064\u304C\u306A\u3093\u3060\u304B\u3068\u3063\u3066\u3082\u7A81\u62CD\u5B50\u3082\u306A\u3044\u3053\u3068\u306B\u805E\u3053\u3048\u308B\u3001<br> \u305D\u3093\u306A\u4EBA\u3082\u3044\u308B\u304B\u3082\u3057\u308C\u306A\u3044\u3002<br> \u4FFA\u306F\u4ECA\u307E\u3067\u81EA\u5206\u304C\u6301\u3063\u3066\u3044\u305F\u65E2\u6210\u6982\u5FF5\u3092\u6368\u3066\u308B\u3053\u3068\u304B\u3089\u3082\u3046\u4E00\u5EA6\u6B69\u304D\u51FA\u3057\u3066\u307F\u3088\u3046\u3068\u601D\u3063\u305F\u3093\u3060\u3002<br> \u4E00\u4EBA\u3072\u3068\u308A\u306E\u60A9\u307F\u3092\u4FFA\u304C\u80CC\u8CA0\u3044\u8FBC\u3080\u3053\u3068\u306F\u3067\u304D\u306A\u3044\u304B\u3082\u3057\u308C\u306A\u3044\u3002<br> \u305F\u3060\u3001\u305D\u3053\u306B\u305F\u3068\u3048\u3070\u4FFA\u306E\u8A00\u8449\u3092\u6C42\u3081\u3066\u3001<br> \u50D5\u3068\u4F55\u304B\u3092\u5206\u304B\u3061\u5408\u304A\u3046\u3068\u3059\u308B\u305D\u3093\u306A\u4EBA\u9593\u304C\u3001\u305D\u3093\u306A\u4EBA\u304C\u3044\u305F\u3089\u3001<br> \u4ECA\u306E\u4FFA\u3060\u3063\u305F\u3089\u304D\u3063\u3068\u4F55\u306E\u305F\u3081\u3089\u3044\u3082\u306A\u304F\u62B1\u304D\u3057\u3081\u3066\u3084\u308B\u3053\u3068\u304C\u3067\u304D\u308B\u3068\u601D\u3046\u3002<br> \u6642\u306B\u306F\u904E\u3061\u3092\u72AF\u3057\u3066\u3057\u307E\u3046\u3053\u3068\u3082\u304D\u3063\u3068\u3042\u308B\u3060\u308D\u3046\u3002<br> \u3060\u3051\u3069\u3001\u904E\u3061\u306B\u3055\u3048\u3001\u81EA\u5206\u306E\u3053\u306E\u4F53\u3067\u3076\u3064\u304B\u3063\u3066\u3001<br> \u3072\u3068\u3064\u3072\u3068\u3064\u306E\u7269\u4E8B\u3092\u3001\u81EA\u5206\u3067\u89E3\u304D\u660E\u304B\u3057\u3066\u884C\u304B\u306A\u3051\u308C\u3070\u3001<br> \u65B0\u3057\u3044\u7B2C\u4E00\u6B69\u306F\u8E0F\u307F\u51FA\u305B\u306A\u3044\u3088\u3046\u306A\u6C17\u304C\u3059\u308B\u3093\u3060\u3002<br> \u305D\u306E\u305F\u3081\u306B\u50B7\u3064\u304F\u3053\u3068\u3082\u591A\u3044\u304B\u3082\u3057\u308C\u306A\u3044\u3002<br> \u305D\u306E\u305F\u3081\u306B\u547D\u3092\u843D\u3068\u3057\u3066\u3057\u307E\u3046\u304B\u3082\u3057\u308C\u306A\u3044\u3002<br> \u305F\u3060\u3001\u4FFA\u306F\u65B0\u3057\u3044\u7B2C\u4E00\u6B69\u306E\u305F\u3081\u306B\u3053\u306E\u547D\u3092\u8CED\u3051\u308B\u3002<br> \u305D\u308C\u304C\u4FFA\u306E\u751F\u304D\u65B9\u3060\u3001\u7B11\u3044\u305F\u3044\u3084\u3064\u306F\u7B11\u3048\u3002<br> \u4FFA\u3092\u4FE1\u3058\u308B\u3084\u3064\u306F\u3064\u3044\u3066\u6765\u3044\uFF01\uFF01<br> \u4FFA\u306F\u3001\u771F\u5B9F\u3092\u6C42\u3081\u6B69\u304D\u7D9A\u3051\u308B\u3001\u304A\u524D\u3089\u3092\u611B\u3057\u3066\u3044\u308B</p></blockquote><p>\u4ECA\u5929\u771F\u7684\u975E\u5E38\u611F\u8B1D\u5927\u5BB6\u3002<br> \u6211\u89BA\u5F97\u6211\u7DCA\u9589\u8457\u5FC3\uFF0C\u4E00\u76F4\u4EE5\u4F86\u90FD\u6C92\u64C1\u6709\u63A5\u7D0D\u81EA\u5DF1\u4EE5\u5916\u7684\u4E00\u5207\u7684\u5EE3\u95CA\u5FC3\u80F8\u3002<br> \u4ECA\u5929\u7684\u89C0\u773E\u5E2D\u6F06\u9ED1\u5F97\u751A\u9EBC\u4E5F\u770B\u4E0D\u5230\uFF0C<br> \u4F46\u6211\u537B\u611F\u89BA\u80FD\u6E05\u695A\u770B\u5230\u7AD9\u5728\u6700\u5F8C\u7684\u4F60\u7684\u9762\u5BB9\u3002<br> \u6211\u89BA\u5F97\u6211\u5728\u5C0B\u627E\u67D0\u4E9B\u80FD\u76F8\u4FE1\u7684\u6771\u897F\u3002<br> \u53EF\u80FD\u6709\u4EBA\u56E0\u6B64\u800C\u89BA\u5F97\u6211\u7684\u8AAA\u8A71\u807D\u4F86\u5F88\u760B\u72C2\u3002<br> \u6211\u60F3\u6368\u68C4\u81EA\u5DF1\u81F3\u4ECA\u6240\u5E36\u8457\u7684\u65E2\u5B9A\u89C0\u5FF5\uFF0C\u7136\u5F8C\u518D\u4E00\u6B21\u8E0F\u51FA\u4E00\u6B65\u3002<br> \u4E5F\u8A31\u6BCF\u4E00\u500B\u4EBA\u7684\u82E6\u60F1\u4E26\u4E0D\u662F\u6211\u6240\u80FD\u80CC\u8CA0\u7684\uFF0C<br> \u4F46\u662F\uFF0C\u5728\u5176\u4E2D\uFF0C\u5047\u82E5\u6709\u9700\u8981\u6211\u7684\u8AAA\u8A71\uFF0C\u60F3\u8981\u8DDF\u6211\u5206\u4EAB\u67D0\u4E9B\u6771\u897F\u7684\u4EBA\u5B58\u5728\u7684\u8A71\uFF0C<br> \u6211\u60F3\uFF0C\u73FE\u5728\u7684\u6211\u4E00\u5B9A\u80FD\u6BEB\u4E0D\u7336\u8C6B\u7684\u62B1\u8457\u4ED6\u3002<br> \u5076\u7136\u90FD\u6703\u6709\u72AF\u932F\u7684\u6642\u5019\u5427\uFF1F<br> \u4F46\u662F\uFF0C\u6211\u89BA\u5F97\uFF0C\u5C31\u7B97\u662F\u72AF\u932F\uFF0C\u4F46\u82E5\u4E0D\u4EE5\u81EA\u5DF1\u7684\u8EAB\u9AD4\u649E\u904E\u53BB\uFF0C<br> \u9760\u81EA\u5DF1\u53BB\u89E3\u660E\u6BCF\u4E00\u4EF6\u4E8B\u7684\u8A71\uFF0C\u5C31\u7121\u6CD5\u8E0F\u51FA\u65B0\u7684\u4E00\u6B65\u3002<br> \u70BA\u4E86\u9019\u500B\u76EE\u7684\uFF0C\u6216\u8A31\u6703\u53D7\u5230\u5F88\u591A\u50B7\u5BB3\u3002\u70BA\u4E86\u9019\u500B\u76EE\u7684\uFF0C\u751A\u81F3\u53EF\u80FD\u6703\u55AA\u547D\u3002<br> \u53EA\u4E0D\u904E\uFF0C\u70BA\u4E86\u65B0\u7684\u4E00\u6B65\uFF0C\u6211\u8CED\u4E0A\u6211\u9019\u689D\u547D\u3002<br> \u90A3\u5C31\u662F\u6211\u7684\u751F\u5B58\u65B9\u5F0F\uFF0C\u60F3\u7B11\u7684\u4EBA\u5118\u7BA1\u7B11\uFF0C\u76F8\u4FE1\u6211\u7684\u4EBA\u5C31\u8DDF\u8457\u4F86\u5427\uFF01<br> \u6211\uFF0C\u6DF1\u611B\u7E7C\u7E8C\u53BB\u5C0B\u627E\u771F\u5BE6\u7684\u4F60\u5011\u3002</p><hr><p>\u8F49\u8F09\u81EA:</p><ul><li><a href="https://matagorou.hatenablog.com/entry/36972348" target="_blank" rel="noopener noreferrer">\u4EE3\u3005\u6728\u4F53\u80B2\u9928\u3000\uFF12\u65E5\u76EE</a></li><li><a href="http://web.archive.org/web/20110429214124/http://blog.yam.com/forgetnot/category/634985/page=2" target="_blank" rel="noopener noreferrer">1985\u5E7411\u670815\u65E5 \u4EE3\u4EE3\u6728</a></li></ul><p>\u5F8C\u6309\uFF1A1985\u5E74\u4EE3\u4EE3\u6728\u7684\u6642\u5E8F\u4E82\u4E86\uFF0C\u62C6\u51FA\u4F86\u91CD\u65B0\u6574\u7406...</p>',23),a=[b];function t(h,c,n,p,s,d){return e(),l("div",null,a)}var u=r(o,[["render",t]]);export{g as __pageData,u as default};
